/*Table structure for table `my_company` */

DROP TABLE IF EXISTS `my_company`;

CREATE TABLE `my_company` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `name` varchar(30) NOT NULL COMMENT '公司名称',
  `legal_person` varchar(15) DEFAULT NULL COMMENT '法人',
  `reg_capital` tinyint(4) unsigned DEFAULT NULL COMMENT '注册资金',
  `mobile` varchar(11) DEFAULT NULL COMMENT '手机号码',
  `tel` varchar(31) DEFAULT NULL COMMENT '固定电话号码',
  `email` varchar(63) DEFAULT NULL COMMENT '邮箱',
  `contacts` varchar(15) DEFAULT NULL COMMENT '联系人',
  `public_account` varchar(31) DEFAULT NULL COMMENT '对公账户',
  `bank_id` int(10) unsigned DEFAULT NULL COMMENT '银行ID',
  `business_circles_number` varchar(31) DEFAULT NULL COMMENT '工商注册号',
  `business_license_img` varchar(255) DEFAULT NULL COMMENT '营业执照照片,多个用逗号分隔',
  `trademark_img` varchar(255) DEFAULT NULL COMMENT '商标证书照片',
  `other_img` varchar(255) DEFAULT NULL COMMENT '其他证书照片',
  `province_id` int(10) unsigned DEFAULT NULL COMMENT '省份ID,对应表region',
  `city_id` int(10) unsigned DEFAULT NULL COMMENT '市ID',
  `district_id` int(10) unsigned DEFAULT NULL COMMENT '区县ID',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `create_time` int(10) unsigned DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  KEY `index_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='公司信息表';

