/*Table structure for table `my_goods` */

DROP TABLE IF EXISTS `my_goods`;

CREATE TABLE `my_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品id(SKU)',
  `goods_commonid` int(10) unsigned DEFAULT '0' COMMENT '商品公共表id',
  `goods_name` varchar(50) DEFAULT NULL COMMENT '商品名称（+规格名称）',
  `goods_jingle` varchar(150) DEFAULT NULL COMMENT '商品广告词',
  `store_id` int(10) unsigned DEFAULT '0' COMMENT '店铺id',
  `store_name` varchar(50) DEFAULT NULL COMMENT '店铺名称',
  `gc_id` int(10) unsigned DEFAULT '0' COMMENT '商品分类id',
  `gc_id_1` int(10) unsigned DEFAULT '0' COMMENT '一级分类id',
  `gc_id_2` int(10) unsigned DEFAULT '0' COMMENT '二级分类id',
  `gc_id_3` int(10) unsigned DEFAULT '0' COMMENT '三级分类id',
  `brand_id` int(10) unsigned DEFAULT '0' COMMENT '品牌id',
  `goods_price` decimal(10,2) DEFAULT NULL COMMENT '商品价格',
  `goods_promotion_price` decimal(10,2) DEFAULT NULL COMMENT '商品促销价格',
  `goods_promotion_type` tinyint(3) unsigned DEFAULT '0' COMMENT '促销类型 0无促销，1团购，2限时折扣',
  `goods_marketprice` decimal(10,2) DEFAULT NULL COMMENT '市场价',
  `goods_serial` varchar(50) DEFAULT NULL COMMENT '商家编号',
  `goods_storage_alarm` tinyint(3) unsigned DEFAULT '0' COMMENT '库存报警值',
  `goods_click` int(10) unsigned DEFAULT '0' COMMENT '商品点击数量',
  `goods_salenum` int(10) unsigned DEFAULT '0' COMMENT '销售数量',
  `goods_collect` int(10) unsigned DEFAULT '0' COMMENT '收藏数量',
  `goods_spec` text COMMENT '商品规格序列化',
  `goods_storage` int(10) unsigned DEFAULT '0' COMMENT '商品库存',
  `goods_image` varchar(100) DEFAULT '' COMMENT '商品主图',
  `goods_state` tinyint(3) unsigned DEFAULT '1' COMMENT '商品状态 0下架，1正常，10违规（禁售）',
  `goods_verify` tinyint(3) unsigned DEFAULT '10' COMMENT '商品审核 1通过，0未通过，10审核中',
  `areaid_1` int(10) unsigned DEFAULT '0' COMMENT '一级地区id',
  `areaid_2` int(10) unsigned DEFAULT '0' COMMENT '二级地区id',
  `color_id` int(10) unsigned DEFAULT '0' COMMENT '颜色规格id',
  `transport_id` mediumint(8) unsigned DEFAULT '0' COMMENT '售卖区域id',
  `goods_freight` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '运费 0为免运费',
  `goods_vat` tinyint(3) unsigned DEFAULT '0' COMMENT '是否开具增值税发票 1是，0否',
  `goods_commend` tinyint(3) unsigned DEFAULT '0' COMMENT '商品推荐 1是，0否 默认0',
  `goods_stcids` varchar(255) DEFAULT '' COMMENT '店铺分类id 首尾用,隔开',
  `evaluation_good_star` tinyint(3) unsigned DEFAULT '5' COMMENT '好评星级',
  `evaluation_count` int(10) unsigned DEFAULT '0' COMMENT '评价数',
  `is_virtual` tinyint(3) unsigned DEFAULT '0' COMMENT '是否为虚拟商品 1是，0否',
  `virtual_indate` int(10) unsigned DEFAULT NULL COMMENT '虚拟商品有效期',
  `virtual_limit` tinyint(3) unsigned DEFAULT '0' COMMENT '虚拟商品购买上限',
  `virtual_invalid_refund` tinyint(3) unsigned DEFAULT '1' COMMENT '是否允许过期退款， 1是，0否',
  `is_fcode` tinyint(4) DEFAULT '0' COMMENT '是否为F码商品 1是，0否',
  `is_appoint` tinyint(3) unsigned DEFAULT '0' COMMENT '是否是预约商品 1是，0否',
  `is_presell` tinyint(3) unsigned DEFAULT '0' COMMENT '是否是预售商品 1是，0否',
  `have_gift` tinyint(3) unsigned DEFAULT '0' COMMENT '是否拥有赠品:0否,1是',
  `is_own_shop` tinyint(3) unsigned DEFAULT '0' COMMENT '是否为平台自营',
  `company_id` int(10) unsigned DEFAULT '0' COMMENT '企业ID',
  `create_time` int(10) unsigned DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  KEY `company_id_index` (`company_id`)
) ENGINE=InnoDB AUTO_INCREMENT=236 DEFAULT CHARSET=utf8 COMMENT='商品表';

