/*Table structure for table `my_label_code_group` */

DROP TABLE IF EXISTS `my_label_code_group`;

CREATE TABLE `my_label_code_group` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `company_id` int(11) unsigned DEFAULT '0' COMMENT '公司ID',
  `code_count` mediumint(8) unsigned DEFAULT NULL COMMENT '条形码总数量',
  `qr_code_type` tinyint(1) DEFAULT '1' COMMENT '二维码类型: 1=微信无限版,2=网页无限版',
  `templet_id` tinyint(3) unsigned DEFAULT '0' COMMENT '模板ID',
  `code_type` tinyint(1) DEFAULT '1' COMMENT '条形码类型: 1=纯数字,2=字母加数字',
  `is_export` tinyint(1) DEFAULT '0' COMMENT '是否已导出: 0=否,1=是',
  `create_time` int(10) unsigned DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='标签分组表';

