/*Table structure for table `my_scan_record` */

DROP TABLE IF EXISTS `my_scan_record`;

CREATE TABLE `my_scan_record` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `code` varchar(31) DEFAULT NULL COMMENT '条形码',
  `gender` tinyint(1) DEFAULT '0' COMMENT '性别:0=未知,1=男,2=女',
  `province_id` int(10) unsigned DEFAULT '0' COMMENT '省份ID',
  `city_id` int(10) unsigned DEFAULT '0' COMMENT '城市ID',
  `district_id` int(10) unsigned DEFAULT '0' COMMENT '区县ID',
  `query_type` tinyint(1) DEFAULT '1' COMMENT '查询方式:1=网站扫码,2=手机扫码',
  `query_result` tinyint(1) DEFAULT '1' COMMENT '查询结果:1=真码,2=假码',
  `longitude` double DEFAULT NULL COMMENT '经度',
  `latitude` double DEFAULT NULL COMMENT '纬度',
  `scan_ip` char(15) DEFAULT NULL COMMENT '扫码IP',
  `create_time` int(10) unsigned DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 COMMENT='扫码记录表';

