/*Table structure for table `my_wechat_config` */

DROP TABLE IF EXISTS `my_wechat_config`;

CREATE TABLE `my_wechat_config` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `company_id` int(10) unsigned DEFAULT '0' COMMENT '企业ID',
  `app_name` varchar(31) DEFAULT NULL COMMENT '公众号名称',
  `app_id` varchar(63) DEFAULT NULL COMMENT '开发者ID(AppID)',
  `app_secret` char(127) DEFAULT NULL COMMENT '开发者密码(AppSecret)',
  `token` varchar(63) DEFAULT NULL COMMENT '令牌(Token)',
  `encoding_aes_key` varbinary(63) DEFAULT NULL COMMENT '消息加解密密钥(EncodingAESKey)',
  `decrypt_type` tinyint(1) DEFAULT '1' COMMENT '消息加解密方式: 1=明文模式(明文模式下，不使用消息体加解密功能，安全系数较低),2=兼容模式(兼容模式下，明文、密文将共存，方便开发者调试和维护). 3=安全模式(安全模式下，消息包为纯密文，需要开发者加密和解密，安全系数高)',
  `create_time` int(10) unsigned DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='微信公众号配置表';

