/*Table structure for table `my_wechat_user` */

DROP TABLE IF EXISTS `my_wechat_user`;

CREATE TABLE `my_wechat_user` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `wechat_config_id` int(10) unsigned DEFAULT '0' COMMENT '微信公众号配置ID',
  `subscribe` tinyint(1) DEFAULT NULL COMMENT '是否关注公众号: 1=是,0=否',
