  `openid` varbinary(31) DEFAULT NULL COMMENT '用户ID',
  `nickname` varchar(15) DEFAULT NULL COMMENT '用户名称',
  `sex` tinyint(1) DEFAULT NULL COMMENT '性别:0=未知,1男性,2=女性',
  `country` varchar(15) DEFAULT NULL COMMENT '国家',
  `province` varchar(15) DEFAULT NULL COMMENT '省份',
  `city` varchar(15) DEFAULT NULL COMMENT '城市',
  `language` varchar(15) DEFAULT NULL COMMENT '用户的语言',
