  `qr_scene_str` varchar(63) DEFAULT NULL COMMENT '二维码扫码场景描述（开发者自定义）',
  `create_time` int(10) unsigned DEFAULT NULL COMMENT '添加时间',
  `update_time` int(10) unsigned DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(10) unsigned DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  KEY `index_user_config_id` (`wechat_config_id`,`unionid`,`openid`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='微信公众号用户表';

